package com.CarManagementSystem.TrainingMug.entities;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import java.time.LocalDate;@Entity@Table(name = "CarTable")public class CarEntity {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private String name;    private String model;    private LocalDate year;    private Integer price;    private String color;    private String fuelType;    public CarEntity()    {    }    public CarEntity(Long id, String name, String model, LocalDate year, Integer price, String color, String fuelType) {        this.id = id;        this.name = name;        this.model = model;        this.year = year;        this.price = price;        this.color = color;        this.fuelType = fuelType;    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getModel() {        return model;    }    public void setModel(String model) {        this.model = model;    }    public LocalDate getYear() {        return year;    }    public void setYear(LocalDate year) {        this.year = year;    }    public Integer getPrice() {        return price;    }    public void setPrice(Integer price) {        this.price = price;    }    public String getColor() {        return color;    }    public void setColor(String color) {        this.color = color;    }    public String getFuelType() {        return fuelType;    }    public void setFuelType(String fuelType) {        this.fuelType = fuelType;    }}